// src/pages/Dashboard/Dashboard.jsx
import React, { useState } from 'react';
import { Radar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  RadialLinearScale,
  PointElement,
  LineElement,
  Filler,
  Tooltip,
  Legend,
} from 'chart.js';
import './Dashboard.css';

// Register ChartJS components
ChartJS.register(RadialLinearScale, PointElement, LineElement, Filler, Tooltip, Legend);

const Dashboard = () => {
  const [localAnswers, setLocalAnswers] = useState({
    cleanliness: 7,
    sleep: 6,
    noise: 8,
  });

  // Mock top match data (later you can fetch real match from backend)
  const topMatch = {
    cleanliness: 8,
    sleep: 7,
    noise: 7,
  };

  const handleSliderChange = (field) => (value) => {
    setLocalAnswers((prev) => ({
      ...prev,
      [field]: value,
    }));
  };

  const radarData = {
    labels: ['Cleanliness', 'Sleep Schedule', 'Noise Tolerance'],
    datasets: [
      {
        label: 'Your Preferences',
        data: [localAnswers.cleanliness, localAnswers.sleep, localAnswers.noise],
        backgroundColor: 'rgba(255, 123, 140, 0.22)',
        borderColor: 'rgba(255, 123, 140, 0.9)',
        borderWidth: 3,
        pointBackgroundColor: '#ff7b8c',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: '#ff7b8c',
      },
      {
        label: 'Best Match',
        data: [topMatch.cleanliness, topMatch.sleep, topMatch.noise],
        backgroundColor: 'rgba(167, 230, 215, 0.25)',
        borderColor: 'rgba(167, 230, 215, 0.9)',
        borderWidth: 3,
        pointBackgroundColor: '#a7e6d7',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: '#a7e6d7',
      },
    ],
  };

  const radarOptions = {
    responsive: true,
    maintainAspectRatio: true,
    plugins: {
      legend: {
        position: 'top',
        labels: {
          font: { size: 15, weight: 600, family: "'Nunito', sans-serif" },
          color: '#a66f5c',
          padding: 24,
        },
      },
      tooltip: {
        backgroundColor: 'rgba(255,245,240,0.96)',
        titleColor: '#ff7b8c',
        bodyColor: '#a66f5c',
        borderColor: '#ffb3c1',
        borderWidth: 2,
        cornerRadius: 12,
      },
    },
    scales: {
      r: {
        angleLines: { color: 'rgba(166,111,92,0.3)' },
        grid: { color: 'rgba(166,111,92,0.18)' },
        pointLabels: { font: { size: 15, weight: 600 }, color: '#a66f5c' },
        ticks: { stepSize: 2, color: '#a66f5c' },
        min: 0,
        max: 10,
      },
    },
  };

  return (
    <div className="dashboard-page">
      <div className="container">
        <h1 className="page-title">RoomieRadar Dashboard</h1>
        <p className="subtitle">Your cozy compatibility journey~ â™¡</p>

        <div className="card radar-card">
          <h2 className="card-title">Compatibility Radar</h2>
          <div className="radar-container">
            <Radar data={radarData} options={radarOptions} />
          </div>
        </div>

        <div className="card">
          <h2 className="card-title">What-If Explorer âœ§</h2>
          <p style={{ textAlign: 'center', color: '#a66f5c', marginBottom: '1.8rem' }}>
            Play with your preferences and see how it changes~!
          </p>

          <div className="what-if-section">
            <div className="slider-wrapper">
              <label>Cleanliness Preference (1â€“10)</label>
              <input
                type="range"
                min="0"
                max="10"
                step="1"
                value={localAnswers.cleanliness}
                onChange={(e) => handleSliderChange('cleanliness')(Number(e.target.value))}
                style={{ width: '100%' }}
              />
              <div style={{ textAlign: 'center', fontWeight: 'bold', color: '#ff7b8c' }}>
                {localAnswers.cleanliness}
              </div>
            </div>

            <div className="slider-wrapper">
              <label>Sleep Schedule Match (1â€“10)</label>
              <input
                type="range"
                min="0"
                max="10"
                step="1"
                value={localAnswers.sleep}
                onChange={(e) => handleSliderChange('sleep')(Number(e.target.value))}
                style={{ width: '100%' }}
              />
              <div style={{ textAlign: 'center', fontWeight: 'bold', color: '#ff7b8c' }}>
                {localAnswers.sleep}
              </div>
            </div>

            <div className="slider-wrapper">
              <label>Noise Tolerance (1â€“10)</label>
              <input
                type="range"
                min="0"
                max="10"
                step="1"
                value={localAnswers.noise}
                onChange={(e) => handleSliderChange('noise')(Number(e.target.value))}
                style={{ width: '100%' }}
              />
              <div style={{ textAlign: 'center', fontWeight: 'bold', color: '#ff7b8c' }}>
                {localAnswers.noise}
              </div>
            </div>
          </div>

          <button className="update-btn">
            Refresh Compatibility Magic! ðŸ§¸âœ¨
          </button>
        </div>
      </div>

      {/* Cute floating decorations */}
      <div className="decor-bear-1" />
      <div className="decor-bear-2" />
    </div>
  );
};

export default Dashboard;
